@testset "1.2.1.6 (g+h x)^m (a+b x+c x^2)^p (d+e x+f x^2)^q" begin
    (A, B, a, b, c, d, e, f, g, h, x, ) = @variables A B a b c d e f g h x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q=#


    #= ::Section:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q*with*b^2-4*a*c=0=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q*with*e=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+f*x^2)^q=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(A + B*x)*(a + b*x + c*x^2)^1/(d + f*x^2), x, 5, ((b*B + A*c)*x)/f + (B*c*x^2)/(2*f) - ((b*B*d + A*c*d - a*A*f)*atan((sqrt(f)*x)/sqrt(d)))/(sqrt(d)*f^(3/2)) - ((B*c*d - A*b*f - a*B*f)*log(d + f*x^2))/(2*f^2)]
    @test_int [(A + B*x)*(a + b*x + c*x^2)^2/(d + f*x^2), x, 5, ((A*b^2*f - A*c*(c*d - 2*a*f) - b*B*(2*c*d - 2*a*f))*x)/f^2 + ((2*A*b*c*f - B*(c^2*d - b^2*f - 2*a*c*f))*x^2)/(2*f^2) + (c*(2*b*B + A*c)*x^3)/(3*f) + (B*c^2*x^4)/(4*f) - ((A*b^2*d*f - 2*b*B*d*(c*d - a*f) - A*(c*d - a*f)^2)*atan((sqrt(f)*x)/sqrt(d)))/(sqrt(d)*f^(5/2)) - ((2*A*b*f*(c*d - a*f) - B*(c^2*d^2 - 2*a*c*d*f - f*(b^2*d - a^2*f)))*log(d + f*x^2))/(2*f^3)]
    @test_int [(A + B*x)*(a + b*x + c*x^2)^3/(d + f*x^2), x, 5, -(((b^3*B*d*f + 3*A*b^2*f*(c*d - a*f) - 3*b*B*(c*d - a*f)^2 - A*c*(c^2*d^2 - 3*a*c*d*f + 3*a^2*f^2))*x)/f^3) - ((A*b*f*(3*c^2*d - b^2*f - 6*a*c*f) - B*(c^3*d^2 - 3*a*c^2*d*f + 3*a*b^2*f^2 - 3*c*f*(b^2*d - a^2*f)))*x^2)/(2*f^3) + ((b^3*B*f + 3*A*b^2*c*f - A*c^2*(c*d - 3*a*f) - 3*b*B*c*(c*d - 2*a*f))*x^3)/(3*f^2) + (c*(3*A*b*c*f - B*(c^2*d - 3*b^2*f - 3*a*c*f))*x^4)/(4*f^2) + (c^2*(3*b*B + A*c)*x^5)/(5*f) + (B*c^3*x^6)/(6*f) + ((b^3*B*d^2*f + 3*A*b^2*d*f*(c*d - a*f) - 3*b*B*d*(c*d - a*f)^2 - A*(c*d - a*f)^3)*atan((sqrt(f)*x)/sqrt(d)))/(sqrt(d)*f^(7/2)) + ((A*b*f*(3*c^2*d^2 - 6*a*c*d*f - f*(b^2*d - 3*a^2*f)) - B*(c*d - a*f)*(c^2*d^2 - 2*a*c*d*f - f*(3*b^2*d - a^2*f)))*log(d + f*x^2))/(2*f^4)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(A + B*x)/(a + b*x + c*x^2)^1/(d + f*x^2), x, 8, (sqrt(f)*(b*B*d - A*c*d + a*A*f)*atan((sqrt(f)*x)/sqrt(d)))/(sqrt(d)*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))) - ((A*b^2*f + 2*A*c*(c*d - a*f) - b*B*(c*d + a*f))*atanh((b + 2*c*x)/sqrt(b^2 - 4*a*c)))/(sqrt(b^2 - 4*a*c)*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))) + ((B*c*d + A*b*f - a*B*f)*log(a + b*x + c*x^2))/(2*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))) - ((B*c*d + A*b*f - a*B*f)*log(d + f*x^2))/(2*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f)))]
    @test_int [(A + B*x)/(a + b*x + c*x^2)^2/(d + f*x^2), x, 9, (A*b*c*(c*d + a*f) - (A*b - a*B)*(2*c^2*d + b^2*f - 2*a*c*f) - c*(A*b^2*f + 2*A*c*(c*d - a*f) - b*B*(c*d + a*f))*x)/((b^2 - 4*a*c)*(b^2*d*f + (c*d - a*f)^2)*(a + b*x + c*x^2)) - (f^(3/2)*(A*b^2*d*f + 2*b*B*d*(c*d - a*f) - A*(c*d - a*f)^2)*atan((sqrt(f)*x)/sqrt(d)))/(sqrt(d)*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))^2) - ((b^5*B*d*f^2 - 2*A*b^4*f^2*(c*d - a*f) - 4*A*c^2*(c*d - 3*a*f)*(c*d - a*f)^2 + b^3*B*f*(5*c^2*d^2 - 4*a*c*d*f - a^2*f^2) - 4*A*b^2*c*f*(2*c^2*d^2 - 3*a*c*d*f + 3*a^2*f^2) + 2*b*B*c*(c^3*d^3 - 7*a*c^2*d^2*f + 3*a^2*c*d*f^2 + 3*a^3*f^3))*atanh((b + 2*c*x)/sqrt(b^2 - 4*a*c)))/((b^2 - 4*a*c)^(3/2)*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))^2) - (f*(2*A*b*f*(c*d - a*f) + B*(c^2*d^2 - 2*a*c*d*f - f*(b^2*d - a^2*f)))*log(a + b*x + c*x^2))/(2*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))^2) + (f*(2*A*b*f*(c*d - a*f) + B*(c^2*d^2 - 2*a*c*d*f - f*(b^2*d - a^2*f)))*log(d + f*x^2))/(2*(c^2*d^2 - 2*a*c*d*f + f*(b^2*d + a^2*f))^2)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^(p/2)*(d+f*x^2)^q=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(A + B*x)*(a + b*x + c*x^2)^(1/2)/(d - f*x^2), x, 9, -((B*sqrt(a + b*x + c*x^2))/f) - ((b*B + 2*A*c)*atanh((b + 2*c*x)/(2*sqrt(c)*sqrt(a + b*x + c*x^2))))/(2*sqrt(c)*f) - ((B*sqrt(d) - A*sqrt(f))*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f)*atanh((b*sqrt(d) - 2*a*sqrt(f) + (2*c*sqrt(d) - b*sqrt(f))*x)/(2*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*f^(3/2)) + ((B*sqrt(d) + A*sqrt(f))*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f)*atanh((b*sqrt(d) + 2*a*sqrt(f) + (2*c*sqrt(d) + b*sqrt(f))*x)/(2*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*f^(3/2))]
    #= [(A + B*x)*(a + b*x + c*x^2)^(3/2)/(d + f*x^2), x, 10, -(((B*c*d - A*b*f - a*B*f)*sqrt(a + b*x + c*x^2))/f^2) + ((b*B + 2*A*c)*(b + 2*c*x)*sqrt(a + b*x + c*x^2))/(8*c*f) + (B*(a + b*x + c*x^2)^(3/2))/(3*f) + ((b*f*(b*B*d + A*c*d - a*A*f) - (c*d - a*f)*(B*c*d - A*b*f - a*B*f) - (sqrt(f)*(A*b^2*d*f - 2*b*B*d*(c*d - a*f) - A*(c*d - a*f)^2))/sqrt(-d))*atan((b*sqrt(-d) - 2*a*sqrt(f) + (2*c*sqrt(-d) - b*sqrt(f))*x)/(2*sqrt(c*d + b*sqrt(-d)*sqrt(f) - a*f)*sqrt(a + b*x + c*x^2))))/(2*f^(5/2)*sqrt(c*d + b*sqrt(-d)*sqrt(f) - a*f)) - ((b*f*(b*B*d + A*c*d - a*A*f) - (c*d - a*f)*(B*c*d - A*b*f - a*B*f) + (sqrt(f)*(A*b^2*d*f - 2*b*B*d*(c*d - a*f) - A*(c*d - a*f)^2))/sqrt(-d))*atan((b*sqrt(-d) + 2*a*sqrt(f) + (2*c*sqrt(-d) + b*sqrt(f))*x)/(2*sqrt(c*d - b*sqrt(-d)*sqrt(f) - a*f)*sqrt(a + b*x + c*x^2))))/(2*f^(5/2)*sqrt(c*d - b*sqrt(-d)*sqrt(f) - a*f)) - ((b^2 - 4*a*c)*(b*B + 2*A*c)*atanh((b + 2*c*x)/(2*sqrt(c)*sqrt(a + b*x + c*x^2))))/(16*c^(3/2)*f) + ((A*b^2*f - 2*A*c*(c*d - a*f) - b*B*(3*c*d - a*f))*atanh((b + 2*c*x)/(2*sqrt(c)*sqrt(a + b*x + c*x^2))))/(2*sqrt(c)*f^2)] =#


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(A + B*x)/((a + b*x + c*x^2)^(1/2)*(d - f*x^2)), x, 5, -(((B - (A*sqrt(f))/sqrt(d))*atanh((b*sqrt(d) - 2*a*sqrt(f) + (2*c*sqrt(d) - b*sqrt(f))*x)/(2*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(f)*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f))) + ((B + (A*sqrt(f))/sqrt(d))*atanh((b*sqrt(d) + 2*a*sqrt(f) + (2*c*sqrt(d) + b*sqrt(f))*x)/(2*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(f)*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f))]
    @test_int [(A + B*x)/((a + b*x + c*x^2)^(3/2)*(d - f*x^2)), x, 6, -((2*(a*B*(2*c^2*d - b^2*f + 2*a*c*f) + A*(b^3*f - b*c*(c*d + 3*a*f)) + c*(A*b^2*f + b*B*(c*d - a*f) - 2*A*c*(c*d + a*f))*x))/((b^2 - 4*a*c)*(b^2*d*f - (c*d + a*f)^2)*sqrt(a + b*x + c*x^2))) - ((B*sqrt(d) - A*sqrt(f))*sqrt(f)*atanh((b*sqrt(d) - 2*a*sqrt(f) + (2*c*sqrt(d) - b*sqrt(f))*x)/(2*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*(c*d - b*sqrt(d)*sqrt(f) + a*f)^(3/2)) + ((B*sqrt(d) + A*sqrt(f))*sqrt(f)*atanh((b*sqrt(d) + 2*a*sqrt(f) + (2*c*sqrt(d) + b*sqrt(f))*x)/(2*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*(c*d + b*sqrt(d)*sqrt(f) + a*f)^(3/2))]
    @test_int [(A + B*x)/((a + b*x + c*x^2)^(5/2)*(d - f*x^2)), x, 7, -((2*(a*B*(2*c^2*d - b^2*f + 2*a*c*f) + A*(b^3*f - b*c*(c*d + 3*a*f)) + c*(A*b^2*f + b*B*(c*d - a*f) - 2*A*c*(c*d + a*f))*x))/(3*(b^2 - 4*a*c)*(b^2*d*f - (c*d + a*f)^2)*(a + b*x + c*x^2)^(3/2))) - (2*(3*b^6*B*d*f^2 + 24*a^2*B*c^2*f*(c*d + a*f)^2 - A*b^5*f^2*(7*c*d + 6*a*f) - b^4*B*f*(7*c^2*d^2 + 14*a*c*d*f - 3*a^2*f^2) + A*b^3*c*f*(15*c^2*d^2 + 46*a*c*d*f + 43*a^2*f^2) + 2*b^2*B*c*(2*c^3*d^3 + 5*a*c^2*d^2*f + 4*a^2*c*d*f^2 - 11*a^3*f^3) - 4*A*b*c^2*(2*c^3*d^3 + 9*a*c^2*d^2*f + 24*a^2*c*d*f^2 + 17*a^3*f^3) + c*(3*b^5*B*d*f^2 - 2*A*b^4*f^2*(4*c*d + 3*a*f) - 8*A*c^2*(c*d + a*f)^2*(2*c*d + 5*a*f) - b^3*B*f*(17*c^2*d^2 + 10*a*c*d*f - 3*a^2*f^2) + 2*A*b^2*c*f*(15*c^2*d^2 + 22*a*c*d*f + 19*a^2*f^2) + 4*b*B*c*(2*c^3*d^3 + 11*a*c^2*d^2*f + 4*a^2*c*d*f^2 - 5*a^3*f^3))*x))/(3*(b^2 - 4*a*c)^2*(c^2*d^2 + 2*a*c*d*f - f*(b^2*d - a^2*f))^2*sqrt(a + b*x + c*x^2)) - ((B*sqrt(d) - A*sqrt(f))*f^(3/2)*atanh((b*sqrt(d) - 2*a*sqrt(f) + (2*c*sqrt(d) - b*sqrt(f))*x)/(2*sqrt(c*d - b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*(c*d - b*sqrt(d)*sqrt(f) + a*f)^(5/2)) + ((B*sqrt(d) + A*sqrt(f))*f^(3/2)*atanh((b*sqrt(d) + 2*a*sqrt(f) + (2*c*sqrt(d) + b*sqrt(f))*x)/(2*sqrt(c*d + b*sqrt(d)*sqrt(f) + a*f)*sqrt(a + b*x + c*x^2))))/(2*sqrt(d)*(c*d + b*sqrt(d)*sqrt(f) + a*f)^(5/2))]


    @test_int [(1 + 2*x)/(sqrt(-1 + x + x^2)*(-1 + x^2)), x, 5, (-(1/2))*atan((3 + x)/(2*sqrt(-1 + x + x^2))) + (3/2)*atanh((1 - 3*x)/(2*sqrt(-1 + x + x^2)))]


    @test_int [(1 + 2*x)/(sqrt(-1 + x + x^2)*(1 + x^2)), x, 5, (-sqrt((1/2)*(2 + sqrt(5))))*atan((5 + 2*sqrt(5) - sqrt(5)*x)/(sqrt(10*(2 + sqrt(5)))*sqrt(-1 + x + x^2))) + sqrt((1/2)*(-2 + sqrt(5)))*atanh((5 - 2*sqrt(5) + sqrt(5)*x)/(sqrt(10*(-2 + sqrt(5)))*sqrt(-1 + x + x^2)))]


    @test_int [(a - c + b*x)/((1 + x^2)*sqrt(a + b*x + c*x^2)), x, 5, -((sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b*sqrt(a^2 + b^2 - 2*a*c + c^2) - (b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*x)/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*x + c*x^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4))) - (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b*sqrt(a^2 + b^2 - 2*a*c + c^2) + (b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*x)/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*x + c*x^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(g+h*x)*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(A + B*x)*(a + b*x + c*x^2)^1/(d + e*x + f*x^2), x, 6, -(((B*c*e - b*B*f - A*c*f)*x)/f^2) + (B*c*x^2)/(2*f) - ((A*f*(c*e^2 - 2*c*d*f - b*e*f + 2*a*f^2) + B*(f*(b*e^2 - 2*b*d*f - a*e*f) - c*(e^3 - 3*d*e*f)))*atanh((e + 2*f*x)/sqrt(e^2 - 4*d*f)))/(f^3*sqrt(e^2 - 4*d*f)) - ((A*f*(c*e - b*f) - B*(c*e^2 - c*d*f - b*e*f + a*f^2))*log(d + e*x + f*x^2))/(2*f^3)]
    @test_int [(A + B*x)*(a + b*x + c*x^2)^2/(d + e*x + f*x^2), x, 6, ((B*(c*e - b*f)*(f*(b*e - 2*a*f) - c*(e^2 - 2*d*f)) + A*f*(b^2*f^2 - 2*c*f*(b*e - a*f) + c^2*(e^2 - d*f)))*x)/f^4 - ((A*c*f*(c*e - 2*b*f) - B*(b^2*f^2 - 2*c*f*(b*e - a*f) + c^2*(e^2 - d*f)))*x^2)/(2*f^3) - (c*(B*c*e - 2*b*B*f - A*c*f)*x^3)/(3*f^2) + (B*c^2*x^4)/(4*f) - ((A*f*(c^2*(e^4 - 4*d*e^2*f + 2*d^2*f^2) - f^2*(2*a*b*e*f - 2*a^2*f^2 - b^2*(e^2 - 2*d*f)) + 2*c*f*(a*f*(e^2 - 2*d*f) - b*(e^3 - 3*d*e*f))) - B*(c^2*(e^5 - 5*d*e^3*f + 5*d^2*e*f^2) + f^2*(a^2*e*f^2 - 2*a*b*f*(e^2 - 2*d*f) + b^2*(e^3 - 3*d*e*f)) + 2*c*f*(a*e*f*(e^2 - 3*d*f) - b*(e^4 - 4*d*e^2*f + 2*d^2*f^2))))*atanh((e + 2*f*x)/sqrt(e^2 - 4*d*f)))/(f^5*sqrt(e^2 - 4*d*f)) + ((A*f*(c*e - b*f)*(f*(b*e - 2*a*f) - c*(e^2 - 2*d*f)) + B*(c^2*(e^4 - 3*d*e^2*f + d^2*f^2) - f^2*(2*a*b*e*f - a^2*f^2 - b^2*(e^2 - d*f)) + 2*c*f*(a*f*(e^2 - d*f) - b*(e^3 - 2*d*e*f))))*log(d + e*x + f*x^2))/(2*f^5)]


    #= ::Subsubsection::Closed:: =#
